class WordLoop extends React.Component {
    render() {
        return (
            <div id="loopDiv">
                <p id="text">
                    <TextLoop children={["Ccon", "converter", "transparency", "information"]}>
                    </TextLoop>
                </p>

                <style jsx>
                    {`

                        #loopDiv {
                            width: 400px;
                        }

                    `}
                </style>
            </div>
        );
    }
}

export default WordLoop;
